// import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import { Home } from './views/Home'
import { Listar } from './views/Cliente/Listar';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={Home}/>
          <Route path='/listar-clientes' component={Listar}/>
          <Route path='/cadastrar-clientes' component={Criar}/>
          <Route path='/atualizar-clientes' component={Atualizar}/>
          <Route path='/excluir-clientes' component={Excluir}/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
